import java.io.*;
import java.util.*;
import java.lang.*;
import java.awt.*;
import java.awt.geom.*;
import java.math.*;
import java.text.*;
import java.math.BigInteger.*;
import java.util.Arrays; 

public class   STONESS
{
  BufferedReader in;
  StringTokenizer as;
  int nums[],nums2[];
  int[] nums1[];
  boolean con = true;
  ArrayList < Integer >  ar = new ArrayList < Integer >();
  ArrayList < Integer >  ar1 = new ArrayList < Integer >();
  Map<Integer,Integer > map = new HashMap<Integer, Integer>();
  public static void main (String[] args)
  {
    new STONESS  ();
  }
  
  public int GCD(int a, int b) {
    if (b==0) return a;
    return GCD(b,a%b);
  }
  
  
  
  
  
  public STONESS  ()
  {
    try
    {
      
      in = new BufferedReader (new InputStreamReader (System.in));
      int a = nextInt();
      int pointer = 0;
      int total = 0;
      String b = nextLine();
      while(b.charAt(pointer) == '.')
      {
        pointer++;
        if(pointer == a)
          break;
      }
      boolean con = true;
      int count = 1;
      for(int x = pointer+1;x<a;x++)
      {
        if(b.charAt(x) != b.charAt(x-1))
        {
          if(con)
            ar.add(count);
          else
            ar1.add(count);
          count = 1;
          con = !con;
        }
        else
          count++;
        if(x == a-1)
        {
            if(con)
            ar.add(count);
          else
            ar1.add(count);
        }
      }
      for(int x = 0;x<ar1.size();x++)
      {
        total += Math.min(ar1.get(x),ar.get(x));
      }
      System.out.println(total);
    }
    catch(IOException e)
    {
      System.out.println("");
    }
  }
  
  
  
  
  
  
  
  String next () throws IOException
  {
    while (as == null || !as.hasMoreTokens ())
    {
      as = new StringTokenizer (in.readLine ().trim ());
    }
    
    
    return as.nextToken ();
  }
  
  
  
  long nextLong () throws IOException
  {
    return Long.parseLong (next ());
  }
  
  
  int nextInt () throws IOException
  {
    return Integer.parseInt (next ());
  }
  
  
  double nextDouble () throws IOException
  {
    return Double.parseDouble (next ());
  }
  
  
  String nextLine () throws IOException
  {
    return in.readLine ().trim ();
  }
}